import Card from "./Card/Card";
import Full from "./Full/Full";
import './Logement.css'

export default function Logement({type, data, children}){


    return (
        <div>
            {type === 'card' ? 
              <div className='cardList'>
                  {children}
              </div>
            : <Full data={data}/> 
            }
        </div>
    );
}
